contracts/HeraCoinRewarder.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

//Creates an ownable Rewarder Contract (ownable by Hera administrator wallet)
contract HeraCoinRewarder is Ownable {
    //the HeraCoin token contract
    IERC20 heracoin;

    //the default reward amount
    uint256 public reward_amount = 100000000000000;

    //On-chain event when a reward was sent
    event SentRewardTokens(
        uint256 amount,
        address fromAccount,
        address toAccount,
        uint256 totalBalance
    );

    //Constructor takes in the address of the HeraCoin token contract
    constructor(IERC20 _heracoin) {
        heracoin = _heracoin;
    }

    //Returns the HeraCoin balance of this contract
    function getHeraCoinBalance() public view returns (uint256) {
        return heracoin.balanceOf(address(this));
    }

    //Functions for reward payments

    //Allows the owner of the contract to adjust what the default reward amount is
    function setRewardAmount(uint256 reward) public onlyOwner returns (bool) {
        reward_amount = reward;
        return true;
    }

    //Returns the default reward amount
    function getRewardAmount() public view returns (uint256) {
        return reward_amount;
    }

    //Sends a defined address the default reward amount in HeraCoin (from this contract's balance) and emits the SentRewardTokens event to the blockchain
    function sendRewardForEmrCreation(address patient) public {
        heracoin.transfer(patient, reward_amount);
        emit SentRewardTokens(
            reward_amount,
            address(this),
            patient,
            heracoin.balanceOf(address(this))
        );
    }
}

contracts/EMRStorageContract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "./EMRContractDatabase.sol";

struct EMR {
    string record_type;
    string record_status;
    uint256 record_date;
    uint256 publish_date;
    string ipfs_image_hash;
    string ipfs_data_hash;
}

contract EMRStorageContract is Ownable {
    using Counters for Counters.Counter;
    Counters.Counter private emrIdCounter;

    event EMRCreated(address patient, uint256 record_id);

    event EMRAccessed(address accessor, uint256 record_id);

    mapping(uint256 => EMR) private emrs;
    uint256[] private emrIds;

    EMRContractDatabase database;

    constructor(EMRContractDatabase _database) {
        database=_database;
    }

    function addRecord(
        string memory _record_type,
        string memory _record_status,
        uint256  _record_date,
        uint256  _publish_date,
        string memory _ipfs_image_hash,
        string memory _ipfs_data_hash
    ) public onlyOwner {
        uint256 _recordId = emrIdCounter.current();
        emrs[_recordId] = EMR(
            _record_type,
            _record_status,
            _record_date,
            _publish_date,
            _ipfs_image_hash,
            _ipfs_data_hash

        );
        emrIdCounter.increment();
        emrIds.push(_recordId);
        database.sendRewardForEmrCreation(msg.sender);

        emit EMRCreated(owner(), _recordId);
    }

    function voidEMR(uint256 _emrID) public onlyOwner {
        for (uint256 i = 0; i < emrIds.length; i++) {
            if (emrIds[i] == _emrID) {
                delete emrIds[i];
                emrIds[i] = emrIds[emrIds.length - 1];
                emrIds.pop();
                break;
            }
        }    
    }

    function getEMR(uint256 _emrID) public view onlyOwner returns(EMR memory) {
        return emrs[_emrID];
    }

    function getEMRIDs() public view onlyOwner returns(uint256[] memory){
        return emrIds;
    }

}

